    /**
     * Test Test_ATCpn_validateInputData_001 method
     * @codeCoverageIgnore
     * @test
     *
     * @return void
     */
    public function Test_ATCpn_validateInputData_001()
    {
        //case 7: all validated
        $data = [
            'checkTime' => [
                'opendata' => [
                    'year' => '2017',
                    'month' => '02',
                    'day' => '22',
                    'hour' => '17',
                    'minute' => '55'
                ],
                'timerdata' => [
                    'year' => '2018',
                    'month' => '05',
                    'day' => '22',
                    'hour' => '17',
                    'minute' => '55'
                ],
            ],
            'title' => '正しいタイトル',
            'contents' => '会員限定キャンペーンバナーの一覧です。[編集]ボ',
            'openData' => [
                'year' => '2017',
                'month' => '02',
                'day' => '17',
                'hour' => '17',
                'minute' => '55'
            ],
            'timerData' => [
                'year' => '2017',
                'month' => '02',
                'day' => '05',
                'hour' => '17',
                'minute' => '55'
            ],
        ];
        $data['bypass'] = ['title' => true, 'contents' => true, 'openData' => true, 'timerData' => true];
        $validator = $this->component->validateInputData(new NoptBaseValidator());
        $errors = $validator->errors($data);
        $expect = [];
        $this->assertEquals($expect, $errors);
    }

    /**
     * Test Test_ATCpn_validateInputData_002 method
     * @codeCoverageIgnore
     * @test
     *
     * @return void
     */
    public function Test_ATCpn_validateInputData_002()
    {
        //case 1: empty title
        $data = [
            'title' => '',
        ];
        $data['bypass'] = ['title' => true, 'contents' => true, 'openData' => true, 'timerData' => true];
        $validator = $this->component->validateInputData(new NoptBaseValidator());
        $errors = $validator->errors($data);
        $expect = [
            'title' => ['noValue' => 'タイトルを入力してください。'],
        ];
        $this->assertEquals($expect, $errors);
    }

